import Item from "./Item";
import { v4 as uuidv4 } from 'uuid';
import './Transection.css'
const Transection = ()=>{
    return (
        <ul className="item-list">
          {data.map((element)=>{
              return <Item {...element} key={uuidv4()}/>
          })}
      </ul>
    )
}

export default Transection
